string backslash(string const &str)
{
  string new_str = "";

  for(unsigned int i = 0; i < str.size(); i++)
  {
    if(str[i] == '\\')
    {
      new_str += str[i];
    }
    new_str += str[i];
  }

  return new_str;
}


wstring escape(string const &str)
{
  regmatch_t pmatch;

  char const *mystring = str.c_str();
  int base = 0;
  wstring result = L"";

  while(!regexec(&escape_chars, mystring + base, 1, &pmatch, 0))
  {
    bufferAppend(result, str.substr(base, pmatch.rm_so));
    result += L'\\';
    wchar_t micaracter;
    size_t pos = mbtowc(&micaracter, str.c_str() + base + pmatch.rm_so, MB_CUR_MAX);
    if(pos == (size_t)-1)
    {
      wcerr << L"Encoding error." << endl;
      exit(EXIT_FAILURE);
    }

    result += micaracter;
    base += pmatch.rm_eo;
  }

  bufferAppend(result, str.substr(base));
  return result;
}

wstring escape(wstring const &str)
{
  string dest = "";

  for(size_t i = 0, limit = str.size(); i < limit; i++)
  {
    char symbol[MB_CUR_MAX+1];
    int pos = wctomb(symbol, str[i]);
    if(pos == -1)
    {
      symbol[0] = '?';
      pos = 1;
    }
    symbol[pos] = 0;
    dest.append(symbol);
  }
  return escape(dest);
}

wstring get_tagName(string tag) {
  regmatch_t pmatch;
  
  char const *mystring = tag.c_str();
  wstring tmp = L"";
  wchar_t mychar;

  if(!regexec(&names_regexp, mystring, 1, &pmatch, 0))
  {
    bufferAppend(tmp, tag.substr(pmatch.rm_so, pmatch.rm_eo - pmatch.rm_so));
  }

  return tmp;
}


