void usage(string const &progname)
{

  cerr << "USAGE: " << progname << " format_file [input_file [output_file]" << ']' << endl;
  
  cerr << "rtf format processor " << endl;
  exit(EXIT_SUCCESS);  
}

int main(int argc, char *argv[])
{
  LtLocale::tryToSetLocale();

  if(argc > 4 || argc < 2)
  {
    usage(argv[0]);
  }
 
  switch(argc)
  {
    case 4:
      yyout = fopen(argv[3], "w");
      if(!yyout)
      {
        usage(argv[0]);
      }
    case 3:
      yyin = fopen(argv[2], "r");
      if(!yyin)
      {
        usage(argv[0]);
      }
    case 2:
      formatfile = fopen(argv[1], "w");
      if(!formatfile)
      {
        usage(argv[0]);
      }
      break;
    default:
      break;
  }
  
  // prevent warning message
  yy_push_state(1);
  yy_top_state();
  yy_pop_state();

  S1_init();

  fputws(L"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n", formatfile);
  fputws(L"<format>\n", formatfile);


  last = "";
  buffer = L"";
  isDot = hasWrite_dot = hasWrite_white = false;
  current=0;
  offset = 0;
  init_escape();
  init_tagNames();
  yylex();


  print_emptyTags();
  fputws(L"</format>", formatfile);
  fclose(formatfile);

  fclose(yyin);
  fclose(yyout);
}

